prompt_example:
Δεδομένου ότι Ενώ η δήλωση είναι καλύτερη, η απάντηση δίνει τη νοητική εικόνα της ολοκλήρωσης. Επομένως, πρέπει να ισχύει ότι "Η δήλωση δεν είναι καλύτερη."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Ο Τζέρεμι Πίττ απάντησε στο γέλιο με μία βρισιά. Επομένως, πρέπει να ισχύει ότι "Ο Τζέρεμι Πίτ απάντησε στο γέλιο χαχανίζοντας και ρίχνοντας ένα μια γροθιά στο πρόσωπο του αυτού που γελούσε."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Περιλαμβάνουν ένα σταθερό μέλλον του ομοσπονδιακού προϋπολογισμού, την τεχνολογική καινοτομία και τις βελτιώσεις στις λειτουργίες και παροχή υπηρεσιών από κυβερνητικούς οργανισμούς. Επομένως, πρέπει να ισχύει ότι "Θα έπρεπε να έχουν συμπεριληφθεί περισσότερα πράγματα."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
